export const API_BASE = "https://localhost:7154/api";

export const API = {
  users: `${API_BASE}/user`,
  bookings: `${API_BASE}/bookings`,
  cancelBooking: (id: string) => `${API_BASE}/bookings/cancel/${id}`,
  batches: `${API_BASE}/batches`,
  payments: `${API_BASE}/payments`,
  services: `${API_BASE}/services`
};
